(67826, 4647, 'LORA', 'lora', '<p>&nbsp;<span style=\"font-size: 1rem;\">שולחן דגם LORA זה בדיוק השולחן שחסר&nbsp;</span></p><p>לסלון שלך.</p><p>שולחן&nbsp;<span style=\"font-size: 1rem;\">מיוחד בעיצוב מודרני יוקרתי בשילוב ברזל וזכוכית</span></p><p>מידות השולחן.</p><p>גדול 90*90 ס\"מ</p><p>בינוני 73*73 ס\"מ</p><p>קטן 53*53 ס\"מ</p>', NULL, NULL, '', '3200', '2700', '20', 'שולחנות סלון-שולחן מעוצב', 1, 1, 1),
(67827, 4647, 'LORA MDF', 'lora-mdf', '<p>שולחן דגם LORA זה בדיוק השולחן שחסר </p><p>לסלון שלך.</p><p>שולחן <span style=\"font-size: 1rem;\">מיוחד בעיצוב מודרני יוקרתי </span></p><p><br></p><p>זמין בשני צבעים אלון - אגוז</p><p>מידות השולחן.</p><p>גדול 90*90 ס\"מ</p><p>בינוני 73*73 ס\"מ</p><p>קטן 53*53 ס\"מ</p>', NULL, NULL, '', '3200', '2700', '20', 'שולחן סלון.שולחן סלון מעוצב', 1, 1, 0),
(67828, 4647, 'MYKONOS', 'mykonos', ' <p>זוג שולחנות סלון מורבעיים</p><p>עשויים מרגל מתכת משולב בעץ וזכוכית </p><p>שולחן דגם מיקונוס מתאים עיצוב פנים</p><p>זמין בשני צבעים אלון - אגוז </p><p>מידות השולחן.</p><p>75*75 ס\"מ</p><p>75*75 ס\"מ</p> ', NULL, NULL, '', '3300', '2700', '20', 'שולחן סלון', 1, 1, 1),
(67829, 4647, 'ELLA', 'ella', '<p>שולחן סלון ברמת עיצוב גבוהה</p><p>עיצוב מודרני משלב בין עץ פרזל וזכוכית</p><p>שולחן דגם ELLA מתאים לכל סגנון עיצוב פנים</p><p>מידות </p><p>רוחב 60 ס\"מ</p><p>אורך 130ס\"מ</p><p><br></p>', NULL, NULL, '', '2300', '1900', '20', 'שולחן סלון', 1, 1, 1),
(67830, 4647, 'LEO', 'leo', '<p>הסלון שלכם הולך להשתדרג בדיוק כמו שחלמתם</p><p>עם שולחן סלון דגם LEO משולב בזכוכית שחורה ורגל מתכת&nbsp;</p><p>מעוצב בסגנון מודרני יוקרתי</p><p>מידות.</p><p>גדול 120*60 ס\"מ</p><p>קטן 70*40 ס\"מ</p><p><br></p>', NULL, NULL, '', '00', '2000', '20', 'שולחן סלון', 1, 1, 0),
(67831, 4647, 'מרצדס.GOLD', 'gold', '<p>סט שולחנות סלון זכוכית שחורה בשילוב רגלים ממתכת</p><p>בעיצוב מודרני יוקרתי</p><p>שולחן דגם מרצדס בזהב מבריק</p><p>מידות.</p><p>גדול 90*90 ס\"מ</p><p>קטן 60*60 ס\"מ</p>', NULL, NULL, '', '2500', '2100', '20', 'שולחן סלון', 1, 1, 0),
(67832, 4647, 'LEO GOLD', 'leo-gold', ' <p>הסלון שלכם הולך להשתדרג בדיוק כמו שחלמתם</p><p>עם שולחן סלון דגם LEO משולב בזכוכית שחורה ורגל מתכת&nbsp;</p><p>מעוצב בסגנון מודרני יוקרתי</p><p>מידות&nbsp;</p><p>גדול 120*60 ס\"מ</p><p>קטן 70*40 ס\"מ</p> ', NULL, NULL, '', '2700', '2100', '20', 'שולחן סלון', 1, 1, 0),
(67833, 4647, 'מרצדס שחור', '', '<p>זוג שולחנות דגם מרצדס בעיצוב יוקרתי</p><p>השולחנות עשויים מזכוכית שחורה עם רגל מתכת&nbsp;</p><p>מידות</p><p>גדול 90*90 ס\"מ</p><p>קטן 60*60 ס\"מ</p>', NULL, NULL, '', '2500', '2100', '20', 'שולחן עגול', 1, 1, 0),
(67834, 4647, 'SANTORINI', 'santorini', ' <p>סט שולחנות עגולים מעוצבים בסגנון מודרהי יוקרתי&nbsp;</p><p>שולחן דגם סנטוריני הוא שולחן העשוי מזכוכית שחורה</p><p>עם רגל מתכת בשחור</p><p>מידות&nbsp;</p><p>גדול 80*80 ס\"מ</p><p>קטן 60*60 ס\"מ</p> ', NULL, NULL, '', '2400', '1900', '20', 'שולחן סלון', 1, 1, 0),
(67835, 4647, 'SANTORINI GOLD', 'santorini-gold', '<p>סט שולחנות עגולים מעוצבים בסגנון מודרני יוקרתי</p><p>שולחן דגם סאנטוריני הוא שולחן העשוי</p><p>מזכוכית שחורה עם רגל מתכת בזהב מבריק</p><p>מידות</p><p><span style=\"font-size: 1rem;\">גדול 80*80 ס\"מ</span></p><p>קטן 60*60 ס\"מ</p>', NULL, NULL, '', '2600', '2100', '20', 'שולחן זהב ', 1, 1, 0),
(67836, 4647, 'ROME', 'rome', ' <p>שולחן דגם רומא שולחן מיוחד עם שולחן גדול וארבעה קטנים</p><p>&nbsp;שולחנות איכותים בעיצוב מושלם</p><p>עם רגלים ברזל שחור&nbsp;</p><p>השולחנות הקטנים נכנסים מתחת לשולחן הגדול</p><p>זמין בשני צבעים אלון -אגוז</p><p>מידות</p><p>גדול 90*90 ס\"מ</p><p>קטן 45*45*(4) ס\"מ</p> ', NULL, NULL, '', '2400', '2000', '20', 'שולחן מיוחד', 1, 1, 0),
(67837, 4647, 'IDAN', 'idan', ' <p>סט 3 שולחנות איכותים בעיצוב מושלם</p><p>עם רגלים ברזל שחור </p><p>השולחנות הקטנים נכנסים מתחת לשולחן הגדול</p><p>זמין בשני צבעים אלון -אגוז</p><p>מידות</p><p>גדול 120*70 ס\"מ</p><p>קטן-2 65*55</p> ', NULL, NULL, '', '2400', '2000', '20', 'שולחן עץ', 1, 1, 0),
